import React, {Component} from "react"
import { Route, Link, Switch, BrowserRouter as Router } from 'react-router-dom'
//import './App.css';

import Home from "../pages/home"
import Contact from "../pages/Contact";
import Project from "../pages/project";
import pic from "../assets/images/pic.jpg"
import pdf from "../assets/cv.pdf";




class Menu extends Component {
  constructor() {
    super();
    this.state = {
      route: false,
    };
  }
  handleCv = () => {

  };


  render() {
    return (
      <Router className="container text-center">
        <div className="menus">
          <nav className="navbar menu navbar-expand-xlg navbar-light ">
            <button
              type="button"
              className="navbar-toggler"
              data-toggle="collapse"
              data-target="#dropDrown"
            >
              <span className="navbar-toggler-icon"> </span>
            </button>

            <div className="collapse   navbar-collapse" id="dropDrown">
              <ul className="navbar-nav  mr-auto">
                <li className="nav-item text-left">
                  <Link to={"/"} className="">
                    
                    <img className="profile-image" src={pic} alt={pic} />{" "}
                  </Link>
                  <div>
                    <p>
                      EGOBA KELVIN <br />
                      FULL-STACK WEB DEVELOPER
                    </p>
                  </div>
                </li>

                <li className="nav-item text-left">
                  <Link to={"/project"} className="nav-link ">
                    {" "}
                    Portfolio{" "}
                  </Link>
                </li>
                <li className="nav-item text-left">
                  <i className="nav-link" onClick={this.handleCv}>
                    {" "}
                    My-CV{" "}
                  </i>
                </li>
                <li className="nav-item text-left">
                  <Link to={"/contact"} className="nav-link">
                    {" "}
                    Contact{" "}
                  </Link>
                </li>
                <li className="nav-item text-left">
                  <Link to={"/blog"} className="nav-link">
                    {" "}
                    Blog{" "}
                  </Link>
                </li>
              </ul>
            </div>
          </nav>
        </div>
        <Switch>
          <Route exact path="/" component={Home} />
          <Route exact path="/contact" component={Contact} />
          <Route exact path="/project" component={Project} />
        </Switch>
      </Router>
    );
  }
}



export default Menu
